#滑动窗口版（优)
def lengthOfLongestSubstring(s: str) -> int:
    # if not s: return 0
    # length = len(s)
    # ans,i,j= 0,0,0
    # map = set()
    # while(i<length and j <length):
    #     if not map.
        if not s: return 0
        left = 0
        lookup = set()
        n = len(s)
        max_len = 0
        cur_len = 0
        for i in range(n):
            cur_len += 1
            while s[i] in lookup:
                lookup.remove(s[left])
                left += 1
                cur_len -= 1
            if cur_len > max_len: max_len = cur_len
            lookup.add(s[i])
        return max_len
